class PassYaMap extends React.Component {

  constructor(props) {
    super(props);

    this.map = React.createRef();

    //this.mapRef = React.createRef();

    this.state = {
      location_type: props.route.params.location_type,
      lon: '',
      lat: '',
      wrong_location: false,
      address_map_data: { address: '' },
      mkad_polygon: mkad_polygon_coordinates,
      mkad_polygon_inner_ring: [ ttk_polygon_coordinates ],
      ttk_polygon: ttk_polygon_coordinates,
      ttk_polygon_inner_ring: [ sk_polygon_coordinates ],
      sk_polygon: sk_polygon_coordinates,
    };
  }

  yaMapLongPress = (point) => {
    console.log('yaMapLongPress')

    console.log('point')
    console.log(point)

    this.setState({ lon: point.lon, lat: point.lat, wrong_location: false })

    Api.post('/get-address-map', { lon: point.lon, lat: point.lat, location_type: this.state.location_type })
       .then(res => {

          const data = res.data;
          console.log(data);

          if(data.auth_required == 1)
          {
            this.props.navigation.navigate('Auth')
          }
          else
          {
            if(typeof(data.address_map_data.address) != 'undefined')
            {
              this.setState({address_map_data: data.address_map_data})
            }
            else
            {
              this.setState({address_map_data: { address: '' }, wrong_location: true})
            }
          }
        })
        .catch(error => {
          console.log('error.response.status = ' + error.response.status);
          if(error.response.status == 401) { this.props.navigation.navigate('Auth') }
        });
  }

  setMarkerPos = () => {
    return { lon: this.state.lon, lat: this.state.lat }
  }

  componentDidMount() {
    console.log('PassYaMap DidMount')

    console.log('this.state.location_type = ' + this.state.location_type)

    if(this.map.current)
    {
      if(this.state.location_type == 'mkad' || this.state.location_type == '')
      {
        this.map.current.setCenter({ lat: 55.74954, lon: 37.621587 }, 10, 0, 0, 0.7, Animation.SMOOTH)
      }
      else if(this.state.location_type == 'ttk')
      {
        this.map.current.setCenter({ lat: 55.74954, lon: 37.621587 }, 11.4, 0, 0, 0.7, Animation.SMOOTH)
      }
      else if(this.state.location_type == 'sk')
      {
        this.map.current.setCenter({ lat: 55.74954, lon: 37.621587 }, 12.4, 0, 0, 0.7, Animation.SMOOTH)
      }
    }
  }

  render() {
    return (
      <View style={styles.container}>

        <Text style={styles.header}> </Text>

        <TouchableHighlight
          style={styles.header_back}
          onPress={() => {
            console.log('-> move to Pass')
            this.props.navigation.navigate('Pass', { address_map_data: this.state.address_map_data })
          }}>
          <Image source={require('../images/back.png')} />
        </TouchableHighlight>

        <Text style={{ paddingLeft: 20, paddingRight: 20, paddingTop: 20, paddingBottom: 20, fontSize: 15, fontWeight: "normal", color: "#E8E8E8" }}>   </Text>

        {
          this.state.address_map_data.address != '' ? (
            <View style={{ position: 'absolute', zIndex: 3, elevation: 3, top: 150, flexDirection: "row", margin: 20, padding: 20, backgroundColor: "#353535", borderRadius: 8 }}>
              <View style={{
                flex: 5,
                flexDirection: "column",
                paddingLeft: 10,
              }}>
                <Text style={{ fontSize: 20, fontWeight: "bold", color: "#E8E8E8"}}>{this.state.address_map_data.address}</Text>
              </View>
            </View>
          ) : null
        }

        {
          this.state.wrong_location ? (
            <View style={{ position: 'absolute', zIndex: 3, elevation: 3, top: 150, flexDirection: "row", margin: 20, padding: 20, backgroundColor: "#353535", borderRadius: 8 }}>
              <View style={{
                flex: 5,
                flexDirection: "column",
                paddingLeft: 10,
                alignItems: 'center',
              }}>
                <Text style={{ fontSize: 20, fontWeight: "bold", color: "#fee600", alignItems: 'center'}}>    </Text>
              </View>
            </View>
          ) : null
        }

        <YaMap
          ref={this.map}
          rotateGesturesEnabled={false}
          showUserPosition={true}
          center={{lat: 55.74954, lon: 37.621587, zoom: 10}}
          //userLocationIcon={{ uri: 'https://www.clipartmax.com/png/middle/180-1801760_pin-png.png' }}
          onMapLongPress={(point) => this.yaMapLongPress(point.nativeEvent)}
          style={{ flex: 1 }}
        >
            <Marker
              point={{ lon: 37.621587, lat: 55.74954 }}
              source={require('../images/moscow_marker.png')}
            />
            {
              this.state.lon != '' && this.state.lat != '' ? (
                <Marker
                  point={this.setMarkerPos()}
                  source={require('../images/address_marker.png')}
                />
              ) : null
            }

            {
              this.state.location_type == 'mkad' ? (
                <Polygon
                  strokeColor="#FF0000"
                  fillColor="rgba(0, 0, 255, 0.15)"
                  points={this.state.mkad_polygon}
                  innerRings={this.state.mkad_polygon_inner_ring}
                />
              ) : null
            }

            {
              this.state.location_type == 'ttk' ? (
                <Polygon
                  strokeColor="#FF0000"
                  fillColor="rgba(0, 255, 0, 0.15)"
                  points={this.state.ttk_polygon}
                  innerRings={this.state.ttk_polygon_inner_ring}
                />
              ) : null
            }

            {
              this.state.location_type == 'sk' ? (
                <Polygon
                  strokeColor="#FF0000"
                  fillColor="rgba(255, 0, 0, 0.15)"
                  points={this.state.sk_polygon}
                />
              ) : null
            }

            {
              this.state.location_type == '' ? (
                <>
                  <Polygon strokeColor="#FF0000" fillColor="rgba(0, 0, 255, 0.15)" points={this.state.mkad_polygon}/>
                  <Polygon strokeColor="#FF0000" fillColor="rgba(0, 255, 0, 0.15)" points={this.state.ttk_polygon}/>
                  <Polygon strokeColor="#FF0000" fillColor="rgba(255, 0, 0, 0.15)" points={this.state.sk_polygon}/>
                </>
              ) : null
            }

        </YaMap>

        {
          this.state.address_map_data.address != '' ? (
            <TouchableHighlight
              style={{ position: 'absolute', zIndex: 3, elevation: 3, left: 10, bottom: 20, right: 10, height: 50, fontSize: 10, margin: 25, borderRadius: 5, alignItems: 'center', justifyContent: 'center', backgroundColor: "#C9A86B" }}
              onPress={() => {
                console.log('call add_address')
                this.props.navigation.navigate('Pass', { address_map_data: this.state.address_map_data })
              }}>
              <Text style={{ fontSize: 24, color: "#E8E8E8" }}></Text>
            </TouchableHighlight>
          ) : null
        }

      </View>
    );
  };
}

export default PassYaMap;
